pragma solidity ^0.4.17;

contract TicTacToe {
    struct Game {
        address first;
        address second;
        byte[9] deck;
        bool finished;
    }

    address public owner;
    mapping(int => Game) games;
    mapping(address => int) participations;

    int gameNumber;

    constructor() public {
        owner = msg.sender;

        gameNumber = -1;
    }

    modifier restricted() {
        if (msg.sender == owner) _;
    }

    function enter() public returns (int) {
        require(participations[msg.sender] != -1);

        if(games[gameNumber].first == 0x0) {
            games[gameNumber].first = msg.sender;
            participations[msg.sender] = gameNumber;
            return gameNumber;
        } else {
            games[gameNumber].second = msg.sender;
            participations[msg.sender] = gameNumber;
            gameNumber += 1;

            return gameNumber - 1;
        }
    }
}
